This sample shows how to call GetByUniqueAttribute and parse the result.

Uri endpoint = new Uri("<https://my-service.azure.com>");
TokenCredential credential = new DefaultAzureCredential();
Lineage client = new PurviewDataMapClient(endpoint, credential).GetLineageClient(apiVersion: "2023-09-01");

Response response = client.GetByUniqueAttribute("<typeName>", "BOTH");

JsonElement result = JsonDocument.Parse(response.ContentStream).RootElement;
Console.WriteLine(result.ToString());

